            crossorigin="anonymous"
          />
          <script
            async
            src="https://www.googletagmanager.com/gtag/js?id=UA-169023996-1"
          />
          <script>{injectGA()}</script>
        </Head>
        {this.props.children}
      </div>
    );
  }
}

export default Layout;
